import * as Noise from '../../node_modules/noisejs';

export default class ProceduralGenerator
{
    static generatePerlinNoise(length, frequency, amplitude) {
        const noise = new Noise.Noise()

        const data = [];
        for (let i = 0; i < length; i++) {
            data.push(noise.simplex2(i * frequency, 0) * amplitude);
        }
        return data;
    }

}
